import React from 'react';
import Button from '../../components/common/Button';
import Header from '../../components/common/Header';
import logo from '../../assets/images/logo.svg';
import image from '../../assets/images/home.png'; // Replace with your actual image path

const HomePage: React.FC = () => {
    return (
        <div className="flex h-screen">
            <div className="flex-1">
                <img src={image} alt="Description" className="w-full h-full object-cover" />
            </div>
            <div className="flex-1 bg-white flex flex-col">
                <Header logo={logo} />
                <div className="flex-grow flex items-center justify-center">
                    <div className="flex flex-col space-y-4">
                        <Button text="Iniciar sesión" className="rounded-full bg-[#C4F439] text-white" />
                        <Button text="Otro botón" className="rounded-full bg-black text-white" />
                    </div>
                </div>
            </div>
        </div>
    );
};

export default HomePage;
